import React from "react";

export default function LinkButton() {
  return (
    <div className="link-btn-container">
      <button
        className="link-btn"
        disabled={this.props.disabled}
        onClick={() => this.props.onClick()}
      >
        {this.props.text}
      </button>
    </div>
  );
}
